import React from 'react';
import {Col, Container, Form, Image} from "react-bootstrap";

const ProductPage = () => {
    const product = {id: 1, title: 'Какаду белохохлый', price: 60000, img: 'https://m.mirkorma.ru/upload/medialibrary/313/313b9efabeb8a8d4ed21f1a7f610c350.jpg'}
    return (
        <Container className="mt-3">
            <Col md={4}>
                <Image width={300} height={300} src={product.img}/>
            </Col>
            <Col md={4}>
                <Form className="mt-3">
                    <h2>{product.title}</h2>
                </Form>

            </Col>
            <Col md={4}>

            </Col>
        </Container>
    );
};

export default ProductPage;
